import SHOP_DATA from "./shop-data.js";

const ORIGIN_STATE = {
  collections: SHOP_DATA,
  test: [1, 2, 3]
};

const shopReducer = (state = ORIGIN_STATE, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default shopReducer;
